    "source": "// SPDX-License-Identifier: UNLICENSED\n\npragma solidity ^0.8.6;\n\nimport \"@openzeppelin/contracts/token/ERC1155/ERC1155.sol\";\nimport \"@openzeppelin/contracts/access/Ownable.sol\";\nimport \"@openzeppelin/contracts/utils/math/SafeMath.sol\"; //Safemath no longer needed Sol v0.8.0 onwards\nimport \"@openzeppelin/contracts/utils/Strings.sol\";\nimport '@openzeppelin/contracts/utils/introspection/ERC165.sol';\n\ninterface IERC2981Royalties {\n    \n    function royaltyInfo(uint256 _tokenId, uint256 _value)\n        external\n        view\n        returns (address _receiver, uint256 _royaltyAmount);\n}\n\n/// @dev This is a contract used to add ERC2981 support to ERC721 and 1155\nabstract contract ERC2981Base is ERC165, IERC2981Royalties {\n    struct RoyaltyInfo {\n        address recipient;\n        uint24 amount;\n    }\n\n    /// @inheritdoc ERC165\n    function supportsInterface(bytes4 interfaceId)\n        public\n        view\n        virtual\n        override\n        returns (bool)\n    {\n        return\n            interfaceId == type(IERC2981Royalties).interfaceId ||\n            super.supportsInterface(interfaceId);\n    }\n}\n\ncontract BaseContract1155 is ERC1155, Ownable, ERC2981Base {\n    using Strings for string;\n    RoyaltyInfo private _royalties;\n\n    string public name;\n    string public symbol;\n\n    uint256 public price = 0.001 ether; //regular price\n    uint256 public whitelistPrice = 0.001 ether; //regular price\n    uint256 public maxSupply = 10000; //total NFT supply\n    uint256 public maxMintAmount = 5; //max mint amount per user\n    uint256 private currentTokenID = 0; //current token ID (currentTokenID +1 will be minted)\n    \n    bool public paused = false;\n    string private baseURI;\n    string private baseContractURI;\n\n    address donationAddress;\n    uint donationPercent=0;\n    \n    mapping(address => bool) public whitelisted;\n\n        //test uri \"https://bee-mint.vercel.app/metadata/{id}.json\"\n    constructor(\n        string memory _initBaseURI,\n        string memory _initContractURI,\n        uint256 _price,\n        uint256 _whitelistPrice,\n        uint256 _maxSupply,\n        uint256 _maxMintAmount,\n        uint _royaltyBasisPoints,\n        address[] memory _whitelistAddresses,\n        address _donationAddress,\n        uint _donationPercent\n        ) ERC1155(_initBaseURI) {\n        setPrice(_price);\n        setWhitelistPrice(_whitelistPrice);\n        setMaxSupply(_maxSupply);\n        setMaxMintAmount(_maxMintAmount);\n        setBaseURI(_initBaseURI);\n        setContractURI(_initContractURI);\n        _setRoyalties(msg.sender , _royaltyBasisPoints);\n        addWhitelisted(_whitelistAddresses);\n        setDonationAddress(_donationAddress);\n        setDonationPercent(_donationPercent);\n    }\n\n  // public\n  function mint(uint256 _mintAmount) public payable {\n        require(!paused);\n        require(_mintAmount > 0);\n        require(_mintAmount <= maxMintAmount);\n        require(currentTokenID + _mintAmount <= maxSupply);\n\n        uint256 cost;\n        if (msg.sender != owner()) {\n\n            if (whitelisted[msg.sender] == true) cost = whitelistPrice;\n            else cost = price;\n            require(msg.value >= cost * _mintAmount, \"Not enough funds\");\n        }\n\n        uint ownedTokens = tokensOwned(msg.sender);\n        require(ownedTokens<maxMintAmount, \"You are trying to mint more tokens than allowed\");\n        \n        for (uint256 i = 1; i <= _mintAmount; i++) {\n            //string.concat(baseURI, currentTokenID+i,baseExtension)\n            _mint(msg.sender, currentTokenID + 1, 1, \"\");\n            currentTokenID++;\n        }\n    }\n\n    //only owner\n    function setPrice(uint256 _newPrice) public onlyOwner {\n       price = _newPrice;\n    }\n\n    function setWhitelistPrice(uint256 _newPrice) public onlyOwner {\n        whitelistPrice = _newPrice;\n    }\n\n    function setMaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner {\n        maxMintAmount = _newmaxMintAmount;\n    }\n\n    function setMaxSupply(uint256 _newmaxSupply) public onlyOwner {\n        maxSupply = _newmaxSupply;\n    }\n\n    function setDonationAddress(address _newDonationAddress) public onlyOwner {\n        donationAddress = _newDonationAddress;\n    }\n\n    function setDonationPercent(uint _newDonationPercent) public onlyOwner {\n        donationPercent = _newDonationPercent;\n    }\n\n    function setBaseURI(string memory _newBaseURI) public onlyOwner {\n        baseURI = _newBaseURI;\n    }\n\n    function setContractURI(string memory _newContractURI) public onlyOwner {\n        baseContractURI = _newContractURI;\n    }\n\n    function pause(bool _state) public onlyOwner {\n        paused = _state;\n    }\n\n    function setName(string memory _name) public onlyOwner {\n        name = _name;\n    }\n\n\n    function setSymbol(string memory _symbol) public onlyOwner {\n        symbol = _symbol;\n    }\n    \n\n    function withdraw() public payable onlyOwner {\n        //require(payable(msg.sender).send(address(this).balance));\n        (bool hs, ) = payable(donationAddress).call{value: address(this).balance * donationPercent / 100}(\"\");\n        require(hs);\n\n        (bool os, ) = payable(owner()).call{value: address(this).balance}(\"\");\n        require(os);\n    }\n\n    function addWhitelisted(address[] memory _users) public onlyOwner {\n        for (uint i = 0; i < _users.length; i++) {\n            whitelisted[_users[i]] = true;\n        }\n    }\n \n    function removeWhitelisted(address[] memory _users) public onlyOwner {\n        for (uint i = 0; i < _users.length; i++) {\n            whitelisted[_users[i]] = false;\n        }\n    }\n\n\n    //PRIVATE FUNCTIONS\n    function tokensOwned(address _address) private view returns(uint) {\n        uint ownedTokens = 0;\n        for(uint256 i = 1; i <= currentTokenID; i++) {\n            ownedTokens += balanceOf( _address, i);\n        }\n        return ownedTokens;\n    }\n\n        // Value is in basis points so 10000 = 100% , 100 = 1% etc\n    function _setRoyalties(address recipient, uint256 value) internal {\n        require(value <= 10000, 'ERC2981Royalties: Too high');\n        _royalties = RoyaltyInfo(recipient, uint24(value));\n    }\n\n    //EXTERNAL\n        function royaltyInfo(uint256, uint256 value)\n        external\n        view\n        override\n        returns (address receiver, uint256 royaltyAmount)\n    {\n        RoyaltyInfo memory royalties = _royalties;\n        receiver = royalties.recipient;\n        royaltyAmount = (value * royalties.amount) / 10000;\n    }\n    \n    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC1155, ERC2981Base) returns (bool) {\n        return super.supportsInterface(interfaceId);\n    }\n\n    function contractURI() public view returns (string memory) {\n        return baseContractURI;\n    }\n\n}",
